def setServoStatesLegs(feet_positions, force, jointDamping):
    p.setJointMotorControlArray(
        hexapod_ID,
        JOINT_INDICES,
        p.POSITION_CONTROL,
        targetPositions=calculateIK3(feet_positions, jointDamping),
        forces=([force] * 18)
    )


